import React from "react";
import { Route} from "react-router-dom"
function App (){
	return(
		<>
		<Route path="/">
			<h1>project</h1>
		</Route>
		<Route>
			<h2>profff</h2>
		</Route>
		</>
	)
	}




 export default App
